      /* Backdrop dim */
      #he-backdrop { display:none; position: fixed; inset: 0; background: rgba(0,0,0,0.3); z-index: 1000; }

      /* Fullscreen panel */
      #he-full { display:none; position: fixed; inset: 0; background: #ffffff; z-index: 1001; }
      #he-full .full-inner { display: flex; flex-direction: column; height: 100%; }

      /* Header */
      #he-full .full-header {
        position: sticky; top: 0;
        display:flex; align-items:center; justify-content:center;
        height: 48px; padding: 0 12px;
        border-bottom: 1px solid #e5e5e5; background: #fff; z-index:2;
        font-weight: 600;
      }
      #he-full .back-btn {
        position:absolute; left: 8px; top: 8px; height: 32px;
        padding: 0 10px; border-radius: 8px; border: 1px solid #d0d0d0; background:#f7f7f7; cursor:pointer;
      }
      #he-full .back-btn span { font-size: 16px; }
      #he-full .title { font-size: 16px; text-align:center; }

      /* Content */
      #he-full .full-content { padding: 10px 12px; overflow-y: auto; -webkit-overflow-scrolling: touch; }

      /* Content styles */
      .pop-wrap { max-width: 960px; margin: 0 auto; font-size: 14px; }
      .pop-wrap .meta { margin: 2px 0 10px 0; font-size: 13px; color: #333; }
      .pop-wrap .cluster-arenas { margin: 8px 0 10px 0; font-size: 13px; line-height: 1.25; }
      .pop-wrap .game-list-container { max-height: none; overflow: visible; }
      .pop-wrap .game-item { margin: 8px 0; line-height: 1.45; white-space: normal; }
      .pop-wrap .game-item .g-line { margin: 3px 0; }
      .pop-wrap .game-item a { text-decoration: none; }
      .pop-wrap .game-divider { height:1px; background:#e0e0e0; margin:8px 0; opacity:0.9; }
    </style>

    <script>
      (function() {
        console.log('[Panel v4] Core JS boot');
        var backdrop=null, panel=null, body=null, titleEl=null, backBtn=null;
        var touchStartY=null, touchMoveY=null, swiping=false;

        function ensureEls() {
          backdrop = document.getElementById('he-backdrop');
          panel = document.getElementById('he-full');
          body = document.getElementById('he-body');
          titleEl = document.getElementById('he-title');
          backBtn = document.getElementById('he-back');
          if (backBtn) backBtn.onclick = closeFull;
          if (backdrop) backdrop.onclick = closeFull;

          // simple swipe-to-close
          panel.addEventListener('touchstart', function(e){
            if (!e.touches || e.touches.length===0) return;
            touchStartY = e.touches[0].clientY;
            touchMoveY = null; swiping = true;
          }, {passive:true});

          panel.addEventListener('touchmove', function(e){
            if (!swiping || !e.touches || e.touches.length===0) return;
            touchMoveY = e.touches[0].clientY;
          }, {passive:true});

          panel.addEventListener('touchend', function(e){
            if (!swiping) return;
            var delta = (touchMoveY==null?0:(touchMoveY - touchStartY));
            console.log('[Panel v4] swipe end, deltaY=', delta);
            if (delta > 80) { closeFull(); }
            swiping = false; touchStartY=null; touchMoveY=null;
          }, {passive:true});

          document.addEventListener('keydown', function(e){ if (e.key==='Escape') closeFull(); });
        }

        window.openFull = function(html, titleText) {
          ensureEls();
          console.log('[Panel v4] openFull()');
          body.innerHTML = html;
          titleEl.textContent = titleText || 'Arena details';
          backdrop.style.display = 'block';
          panel.style.display = 'block';
          // prevent background scroll on mobile
          document.body.style.overflow = 'hidden';
        }
        window.closeFull = function() {
          ensureEls();
          console.log('[Panel v4] closeFull()');
          backdrop.style.display = 'none';
          panel.style.display = 'none';
          body.innerHTML = '';
          titleEl.textContent = '';
          document.body.style.overflow = '';
        }
        console.log('[Panel v4] Core ready');
      })();
    </script>
    
    
    <script>
      (function() {
        function bindAllMarkers() {
          try {
            var mapObj = map_524f8a54906a674cd9d1407dd3ed1c9b;
            if (!mapObj) { console.error('[Panel v4] Map variable not found: map_524f8a54906a674cd9d1407dd3ed1c9b'); return; }
            console.log('[Panel v4] Layer scan started');
            function onLayer(layer) {
              try {
                if (layer && layer.eachLayer) { layer.eachLayer(onLayer); }
                if (layer && layer instanceof L.Marker && layer.options && (layer.options.customHtml || layer.options.customTitle)) {
                  console.log('[Panel v4] Binding marker with customHtml/customTitle');
                  layer.off('click');
                  layer.on('click', function() {
                    console.log('[Panel v4] Marker click -> openFull');
                    if (typeof openFull !== 'function') { console.error('[Panel v4] openFull is not defined!'); return; }
                    openFull(layer.options.customHtml || '', layer.options.customTitle || 'Arena details');
                  });
                }
              } catch (e) { console.error('[Panel v4] Error while processing layer', e); }
            }
            mapObj.eachLayer(onLayer);
            console.log('[Panel v4] Binding complete');
          } catch (err) { console.error('[Panel v4] bindAllMarkers exception', err); }
        }
        if (document.readyState === 'complete') { setTimeout(bindAllMarkers, 150); }
        else { window.addEventListener('load', function(){ setTimeout(bindAllMarkers, 150); }); }
      })();
    </script>
